	// "ὁ": // TOO SHORT // &Entry{Num: 3588, Word: "ὁ", Desc: "Strong&apos;s Number G3588: ho (ho) (including the feminine he  hay, and the neuter  to  to in all their inflections) t.\n1. the\n{sometimes to be supplied, at others omitted, in English idiom}\n[the definite article]\nKJV: the, this, that, one, he, she, it, etc"},
